We present our official application for the enjoyment and comfort of our customers.

Through this application you can:

- Consult Interactive Map with services, routes, schedules and touristic spots;
- Check the nearest bus stop;
- Search services and their schedules;
- View timetables by bus stop;
- Keep up with the latest news from RODOESTE;
- View tariffs and points of sale;
- Receive alerts (push notifications) regarding our service;
- Get in direct contact with us;
- Find out more about the history of RODOESTE and our Workshops.
